- input: '"TEXT","F3A",,"To:  Leah Palmer FEC Reports Analyst and interested FEC Officials.  From:  Hurley
    for Congress Committee- William Hurley Candidate.  Re: Amendment to 12-Day Pre-primary
    Report.  This is in response to your April 23rd 2002 letter wherein you request
    additional financial information about the Committee Pre-primary Report filed
    March 7th 2002.  The specific information sought is to identify the source of
    the funds listed on the Report as Cash on Hand at the beginning of the reporting
    period - January 1st 2002.  The source of the $3063.13 cash on hand balance was
    a loan to the Committee of personal funds by the undersigned candidate- William
    Hurley.  The Committee did not begin soliciting or receiving donations until mid-January
    of 2002.  I expect to forgive any and all funds I have lent to the Committee for
    purposes of running my campaign for Congress.   I apologize for any inconvenience
    this omission of data may caused you or the Commission.  Sincerely  William F.
    Hurley- Hurley for Congress Committee."'
